{
    return vLedPositions;
}

export function Shutdown()
{
    for(let i = 0 ;i < vLedPositions.length;i++){
        SendColorPacket(i, true);
        }

}

export function Validate(endpoint)
{
    return endpoint.interface === 0;
}

export function SendVibrationPacket(type)
{
    var packet = [];
    packet[0x00] = 0x00;
    packet[0x01] = 0x59;
    packet[0x02] = 0x01;
    packet[0x03] = 0x00;
    packet[0x04] = type; //Type of Vibration - 0x01 = Strong Click 0x04 = Sharp Click 0x07 = Soft Bump 0x0A = Double Click 0x1B = Short Double Click 0x0C = Triple Click 0x2F = Buzz 0x0F = Long Buzz 0x18 = Sharp Tick 0x35 = Pulsing 

    device.write(packet, 32);
}


function SendColorPacket(zoneid, shutdown = false) {
    var packet = [];
    var iPxX = vLedPositions[zoneid][0];
    var iPxY = vLedPositions[zoneid][1];

    var color;
    if(shutdown){
        color = hexToRgb(shutdownColor)
    }else if (LightingMode == "Forced") {
        color = hexToRgb(forcedColor)
    }else{
        color = device.color(iPxX, iPxY);
    }

    packet[0x00] = 0x00;
    packet[0x01] = 0x05;
    packet[0x02] = 0x00;
    packet[0x03] = zoneid
    packet[0x04] = color[0];
    packet[0x05] = color[1];
    packet[0x06] = color[2];
    packet[0x07] = 0xFF;
    packet[0x08] = 0x32
    packet[0x09] = 0xC8;
    packet[0x0A] = 0xC8;
    packet[0x0D] = 0x01;
    packet[0x0E] = zoneid;


    device.send_report(packet, 579);
    device.pause(1)
}

export function Render() {
    for(let i = 0 ;i < vLedPositions.length;i++){
        SendColorPacket(i);
    }

    if(savedDpi1 != dpi1 && DpiControl){
        setDpi(1,dpi1)
    }
    if(savedDpi2 != dpi2 && DpiControl){
        setDpi(2,dpi2)
    }
    if(ScreenControl && sceenInit == false){
        sceenInit = true;
        device.send_report(SignalLogoWhite,579);
    }
    device.pause(1)
    SendVibrationPacket();
}

function setDpi(channel, dpi){
    savedDpi1 = dpi1;
    var packet = [];
    packet[0] = 0x00;
    packet[1] = 0x03;
    packet[2] = 0x00;
    packet[3] = channel;
    packet[4] = (dpi/100) -1;
    packet[6] = 0x42;
    device.write(packet, 33);
}
function hexToRgb(hex) {
    var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    var colors = [];
    colors[0] = parseInt(result[1], 16);
    colors[1] = parseInt(result[2], 16);
    colors[2] = parseInt(result[3], 16);

    return colors;
  }


